import React from 'react';
import logo from './../Source/logo.png';
import favorite from './../Source/Favorite.svg';
import search from './../Source/Search.svg';
import speech from './../Source/Speech.svg';
import user from './../Source/User.svg';
import './../App.css';
import Header_CSS from './Header.module.css';
const Header = () => 
{
    return(
        <header className={Header_CSS.header}>
        <div className={Header_CSS.logo_header}>
        <img src={logo} />
        </div>
       <div className={Header_CSS.znakomstva}>
         <img src={favorite}/>Знакомства
         </div>
         <div className={Header_CSS.search}>
         <img src={search}/>Поиск
         </div>
         <div className={Header_CSS.messages}>
         <img src={speech}/>Сообщения
         </div>
         <div className={Header_CSS.profile}>
         <img src={user}/>Профиль
         </div>
      </header>
    )
}

export default Header;
